import React from 'react';
import classes from './css/general-information.module.css';
import icons from './img/icons_kenguru.png';

const GeneralInformation=(props)=>{
    return <div className={classes.main_block}>
        <div className={classes.logo_block}>
            <img src={icons}/>
        </div>
        <div className={classes.header_text}>
            <h3>Кенгуру - агрегатор транспортных компаний в России.<br/>
                Мы не продаем услуги транспортных компаний,<br/>
                а помогаем найти самые выгодные из них.<br/>
                Это бесплатно.</h3>
        </div>
    </div>
}
export default GeneralInformation;
